import "./Footer.css";

function Footer() {
  return (
    <footer className="footer">
      <p>© 2025 TicketNow. All rights reserved.</p>
      <p>
        <a href="/about">Giới thiệu</a> | <a href="/contact">Liên hệ</a>
      </p>
    </footer>
  );
}

export default Footer;
